import Login from '../Image/Login.PNG'
import Logo from '../Image/Logo.PNG';
import { Link } from 'react-router-dom'; 
import '../App.css';

const LoginPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [showPassword, setShowPassword] = useState(false);

  const handleLogin = () => {
    // Logique de connexion
    console.log('Username:', username);
    console.log('Password:', password);
  };

  const handleTogglePassword = () => {
    setShowPassword(!showPassword);
  };


  return (

    <div className="container" >

     <div className="left"> 

     <div className="full-screen-image">
     <img src={Login} alt=''  className="full-width" style={{ width: '800px', height: '950px', objectFit: 'cover' }}/>
     </div>


     </div>

        <div className="right">
        <div className="row">

        <img src={Logo} alt="Logo de l'application"   style={{

            padding: '40px', 
            borderRadius: '10px',
            position: 'absolute',
            top: '20%',
            left: '70%',
            transform: 'translate(-50%, -50%)',
            width: '650px'
          }}/>
        {/* <div style={{ backgroundColor: '#76B5FF', padding: '40px', borderRadius: '50px' }}> */}
        {/* <div className="row">
        <div className="col-sm-6"> */}
        <div className="col-sm-6"
          style={{
            backgroundColor: '#76B5FF',
            padding: '40px',
            borderRadius: '50px',
            position: 'absolute',
            top: '60%',
            left: '70%',
            transform: 'translate(-50%, -50%)',
          }}

        >
      {/* <form style={{  flex: '1', padding: '0 20px' }}> */}
    <div >
          <label>Nom d‚Äôutilisateur </label>
          <br />
          <br/>
          <input
  type="text"
  value={username}
  onChange={(e) => setUsername(e.target.value)}
  className="input-field"
  style={{
    width: '400px', // Ajustez la largeur selon vos besoins
    height: '30px', // Ajustez la hauteur selon vos besoins
    fontSize: '16px', // Ajustez la taille de la police selon vos besoins
    // Autres styles CSS que vous souhaitez appliquer
  }}
/>

        </div>
        <h1></h1>
        <h1></h1>
        <h1></h1>
        <div className="form-group">
          <label>Mot de passe</label>
          <br />
          <br/>
          <div className="password-input">
            <input
              type={showPassword ? 'text' : 'password'}
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="input-field" 
              style={{
                width: '400px', // Ajustez la largeur selon vos besoins
                height: '30px', // Ajustez la hauteur selon vos besoins
                fontSize: '16px', // Ajustez la taille de la police selon vos besoins
                // Autres styles CSS que vous souhaitez appliquer
              }} />
            <button
              type="button"
              onClick={handleTogglePassword}
              className="password-toggle-button"
              style={{
                position: 'absolute',
                right: '50px', // Ajustez la position horizontale du bouton √† l'int√©rieur de la case du mot de passe
                top: '6%', // Ajustez la position verticale du bouton √† l'int√©rieur de la case du mot de passe
                transform: 'translateY(-50%)',
                backgroundColor: 'transparent',
                border: 'none',
                cursor: 'pointer',
              }}
            >
              {showPassword ? 'üëÅÔ∏è' : 'üîí'}
            </button>
          </div>

        </div>
        <br />

        <div className="submit-group">
          <button type="button" onClick={handleLogin} style={{ whiteSpace: 'nowrap' }} className="login-button"   style={{
                width: '400px', // Ajustez la largeur selon vos besoins
                height: '30px', // Ajustez la hauteur selon vos besoins
                fontSize: '16px', // Ajustez la taille de la police selon vos besoins
                // Autres styles CSS que vous souhaitez appliquer
              }}>
            Se connecter
          </button>
        </div>
      {/* </form> */}
      </div>
      {/* </div>
      </div> */}
      <a href="/create-account" style={{

            padding: '40px', 
            borderRadius: '10px',
            position: 'absolute',
            top: '85%',
            left: '83%',
            transform: 'translate(-50%, -50%)',
            width: '650px'
          }}> <p>vous n‚Äôavez pas de compte? s‚Äôinscrire   </p></a>

</div></div>


      </div>











  );
};

export default LoginPage;
